INSERT INTO `movies` VALUES (1, '我不是药神', '一位不速之客的意外到访，打破了神油店老板程勇（徐峥 饰）的平凡人生，他从一个交不起房租的男性保健品商贩，一跃成为印度仿制药“格列宁”的独家代理商。收获巨额利润的他，生活剧烈变化，被病患们冠以“药神”的称号。但是，一场关于救赎的拉锯战也在波涛暗涌中慢慢展开......', '117分钟', '中国', '文牧野', '徐峥,周一围,王传君,谭卓,章宇,杨新鸣,王砚辉', 'http://mobile.bwstudent.com/images/movie/stills/wbsys/wbsys1_h.jpg', 'http://mobile.bwstudent.com/images/movie/stills/wbsys/wbsys1.jpg', 8.90, 0.22, '2018-07-05', '2018-07-16 18:21:03');
INSERT INTO `movies` VALUES (2, '摩天营救', '在香港市中心，世界上最高、结构最复杂的摩天大楼遭到破坏，危机一触即发。威尔·索耶（道恩·强森 饰）的妻子萨拉（内芙·坎贝尔 饰）和孩子们在98层被劫为人质，直接暴露在火线上。威尔，这位战争英雄、前联邦调查局救援队员，作为大楼的安保顾问，却被诬陷纵火和谋杀。他必须奋力营救家人，为自己洗脱罪名，关乎生死存亡的高空任务就此展开。', '102分钟', '美国', '罗森·马歇尔·瑟伯', '道恩·强森,昆凌,文峰,黄经汉', 'http://mobile.bwstudent.com/images/movie/stills/mtyj/mtyj1_h.jpg', 'http://mobile.bwstudent.com/images/movie/stills/mtyj/mtyj1.jpg', 8.50, 0.12, '2020-07-20', '2018-07-16 18:21:03');
INSERT INTO `movies` VALUES (3, '西虹市首富', '故事发生在《夏洛特烦恼》中的“特烦恼”之城“西虹市”。混迹于丙级业余足球队的守门员王多鱼（沈腾 饰），因比赛失利被开除离队。正处于人生最低谷的他接受了神秘台湾财团“一个月花光十亿资金”的挑战。本以为快乐生活就此开始，王多鱼却第一次感到“花钱特烦恼”！想要人生反转走上巅峰，真的没有那么简单.', '118分钟', '中国', '闫非', '沈腾,宋芸烨,张晨光,艾伦,常远', 'http://mobile.bwstudent.com/images/movie/stills/xhssf/xhssf1_h.jpg', 'http://mobile.bwstudent.com/images/movie/stills/xhssf/xhssf1.jpg', 8.60, 0.13, '2020-07-27', '2018-07-25 14:38:17');
INSERT INTO `movies` VALUES (4, '狄仁杰之四大天王', '狄仁杰(赵又廷 饰）大破神都龙王案，获御赐亢龙锏，并掌管大理寺，使他成为武则天（刘嘉玲 饰）走向权力之路最大的威胁。武则天为了消灭眼中钉，命令尉迟真金（冯绍峰 饰）集结实力强劲的“异人组”，妄图夺取亢龙锏。在医官沙陀忠（林更新 饰）的协助下，狄仁杰既要守护亢龙锏，又要破获神秘奇案，还要面对武则天的步步紧逼，大唐江山陷入了空前的危机之中……', '132分钟', '中国', '徐克', '赵又廷,冯绍峰,林更新,刘嘉玲,阮经天,马思纯', 'http://mobile.bwstudent.com/images/movie/stills/drjzsdtw/drjzsdtw1_h.jpg', 'http://mobile.bwstudent.com/images/movie/stills/drjzsdtw/drjzsdtw1.jpg', 8.70, 0.15, '2020-08-27', '2018-07-25 14:38:17');
INSERT INTO `movies` VALUES (5, '邪不压正', '北洋年间，北京以北。习武少年李天然（彭于晏 饰）目睹师兄朱潜龙（廖凡 饰）勾结日本特务根本一郎，杀害师父全家。李天然侥幸从枪下逃脱，被美国医生亨德勒救下。李天然伤愈后，赴美学医多年，并同时接受特工训练。1937年初，李天然突然受命回国。“七七事变”前夜，北平，这座国际间谍之城，华洋混杂，山头林立。每时每刻充满诱惑与杀机。一心复仇的李天然，并不知道自己被卷入了一场阴谋，亦搅乱了一盘棋局。彼时彼刻，如', '137分钟', '中国', '姜文', '姜文,彭于晏,廖凡,许晴,周韵', 'http://mobile.bwstudent.com/images/movie/stills/xbyz/xbyz1_h.jpg', 'http://mobile.bwstudent.com/images/movie/stills/xbyz/xbyz1.jpg', 8.80, 0.18, '2020-07-13', '2018-07-25 14:38:17');
INSERT INTO `movies` VALUES (6, '神奇马戏团之动物饼干', '欧文的叔叔在经营着一家以动物表演闻名的马戏团，但一场大火却让叔叔意外去世，马戏团的表演场也全部化为灰烬。此时，继承马戏团的重担落在了欧文身上，但他却显得犹豫不决，而在叔叔的葬礼上，大伯霍勒肖放话要继承马戏团和宝藏，小丑红鼻头也将一盒贴着“绝对不能吃”的动物饼干交给了欧文，令局势更加混乱……', '94分钟', '美国', '托尼·班克罗夫特', '艾米莉·布朗特,约翰·卡拉辛斯基,西尔维斯特·史泰龙', 'http://mobile.bwstudent.com/images/movie/stills/sqmxtzdwbg/sqmxtzdwbg1_h.jpg', 'http://mobile.bwstudent.com/images/movie/stills/sqmxtzdwbg/sqmxtzdwbg1.jpg', 9.10, 0.25, '2018-09-08', '2018-07-25 14:50:18');
INSERT INTO `movies` VALUES (7, '汪星卧底', '讲述了纽约警局警犬麦克斯（卢达克里斯 配音）与它的人类搭档FBI探员弗兰克（威尔·阿奈特 饰）联手破案的惊险经历。本互不相识且性格迥异的一人一犬，因为一宗珍稀动物偷盗案被强行组队。随后更被派遣到拉斯维加斯参加全球知名犬展，通过卧底行动缉拿罪魁祸首。而此次行动对于“厌狗”的探员弗兰克和不修边幅的麦克斯，远比想象中的艰难……', '93分钟', '美国', '拉加·高斯内尔', '卢达克里斯,威尔·阿奈特,娜塔莎·雷昂', 'http://mobile.bwstudent.com/images/movie/stills/wxwd/wxwd1_h.jpg', 'http://mobile.bwstudent.com/images/movie/stills/wxwd/wxwd1.jpg', 9.20, 0.11, '2018-09-08', '2018-07-25 14:50:18');
INSERT INTO `movies` VALUES (8, '侏罗纪世界2', '侏罗纪世界主题公园及豪华度假村被失控的恐龙们摧毁已有三年。如今，纳布拉尔岛已经被人类遗弃，岛上幸存的恐龙们在丛林中自给自足。当岛上的休眠火山开始活跃以后，欧文（克里斯·帕拉特 饰）与克莱尔（布莱丝·达拉斯·霍华德 饰）发起了一场运动，想要保护岛上幸存的恐龙们免于灭绝。欧文一心想要找到自己依然失踪在野外的迅猛龙首领布鲁，克莱尔如今也尊重起这些生物，以保护它们为己任。两人在熔岩开始喷发时来到了危险的小', '128分钟', '美国', '胡安·安东尼奥·巴亚纳', '克里斯·帕拉特,布莱丝·达拉斯·霍华德,泰德·拉文', 'http://mobile.bwstudent.com/images/movie/stills/zljgy/zljgy1_h.jpg', 'http://mobile.bwstudent.com/images/movie/stills/zljgy/zljgy1.jpg', 9.30, 0.15, '2018-09-08', '2018-07-25 14:50:18');
INSERT INTO `movies` VALUES (9, '小偷家族', '东京高楼林立的大厦之间，残存一个破旧平房，里面住着年迈的母亲柴田初枝(树木希林 饰)、治(Lily Franky 饰)与信代(安藤樱 饰)夫妇，以及他们的儿子祥太(城桧吏 饰)，和信代的妹妹亚纪(松冈茉优 饰)。这家人依赖初枝的老人年金过活。当年金不够用时，就会靠在外头顺手牵羊来补贴家用。虽然他们处在社会的底层，但每天依然快乐地生活着。某个寒冷的冬日，治在周边的公寓发现了一位被冻僵瑟瑟发抖的小女孩(佐佐木美结 饰)，并将她带回了家，照顾起居，成为了家里的一份子。直到有一天，一个意外的事件使得原本融洽的家庭逐渐四分五裂。彼此心中隐藏的秘密与内心深处暗藏的愿望，也逐渐摊在阳光底下......', '117分钟', '日本', '是枝裕和', '中川雅也,安藤樱,松冈茉优,', 'http://mobile.bwstudent.com/images/movie/stills/xtjz/xtjz1_h.jpg', 'http://mobile.bwstudent.com/images/movie/stills/xtjz/xtjz1.jpg', 9.40, 0.18, '2018-09-08', '2018-08-02 17:41:37');
INSERT INTO `movies` VALUES (10, '动物世界', '男主角郑开司（李易峰 饰）因被朋友欺骗而背负上数百万的债务，面对重病的母亲和痴心等待的青梅竹马，他决心登上“命运号”游轮，改变自己一事无成的人生。只要能在渡轮上的游戏中获胜，他就将有机会将债务一笔勾销，并给家人带来更好的生活。这场游戏看似简单，参与者只需以标着“石头，剪刀，布”的扑克为道具，赢取对手身上的星星标志。但游轮上的亡命徒们毫无底线的欺诈争夺，却让人性的自私与残酷暴露无遗，局中局、计中计，让游戏场最终沦为“动物世界”斗兽场。面对绝境的郑开司，能否坚守自我底线保持善良本性？能否凭借自己的智慧和坚韧摆脱困境？这是一场自我救赎的残酷游戏，多重考验也将接踵而至。', '132分钟', '中国大陆,美国', '韩延', '李易峰,迈克尔·道格拉斯,周冬雨', 'http://mobile.bwstudent.com/images/movie/stills/dwsj/dwsj1_h.jpg', 'http://mobile.bwstudent.com/images/movie/stills/dwsj/dwsj1.jpg', 9.50, 0.16, '2018-09-08', '2018-08-02 17:41:37');
INSERT INTO `movies` VALUES (11, '巨齿鲨', '一项由中国主导的国际科研项目，正在马里亚纳海沟深处进行时，遭遇未知生物攻击，科研人员被困海底。前美国海军陆战队深海潜水专家乔纳斯·泰勒（杰森·斯坦森 饰）受命前往营救，再度遭遇数年前曾经在深海给自己留下终身难以磨灭记忆的史前生物巨齿鲨。乔纳斯联手科研项目中的中国女科学家张苏茵（李冰冰 饰）成功营救了被困人员，但营救行动却意外造成了巨齿鲨逃离深海。当史前巨兽重返浅海，人类将为自己对大自然的贪婪付出惨重的代价......', '115分钟', '美国,中国香港,中国大陆', '乔·德特杜巴', '杰森·斯坦森,李冰冰,雷恩·威尔森', 'http://mobile.bwstudent.com/images/movie/stills/jcs/jcs1_h.jpg', 'http://mobile.bwstudent.com/images/movie/stills/jcs/jcs1.jpg', 9.60, 0.12, '2018-09-08', '2018-08-09 18:05:11');
INSERT INTO `movies` VALUES (12, '风语咒', '生活在孝阳岗的少年郎明怀揣侠岚梦想，但双眼失明的他却只能靠招摇撞骗混于市井之中。直到有一天，罗刹袭击孝阳岗，与他相依为命的母亲突然失踪，郎明迫不得已踏上了找寻真相之路。一波未平一波又起，上古神兽饕餮现世让人间危在旦夕，传说中的侠岚们也出现在眼前，郎明也踏上了改变一生的冒险之旅……', '105分钟', '中国大陆 ', '刘阔', '路知行,阎萌萌,褚珺', 'http://mobile.bwstudent.com/images/movie/stills/fyz/fyz1_h.jpg', 'http://mobile.bwstudent.com/images/movie/stills/fyz/fyz1.jpg', 9.70, 0.21, '2018-09-08', '2018-08-02 18:09:39');
INSERT INTO `movies` VALUES (14, '解码游戏', '电玩竞技界大神李浩铭（韩庚 饰）看似是一名宅男程序员，真实身份却是全球排位第一的天才极客“海盗船长”，终于有一天，他享受的平静生活被意外打破，浩铭遭到代号“斑马”的特工乔飞（凤小岳 饰）及其搭档苏仪（李媛 饰）胁迫，要求他加入组织并主力破解号称全球最安全的“绿洲”系统， 此时警方也联系到浩铭，称一直暗中与恐怖组织交易的神秘富豪闫岳（山下智久 饰）宣布将收购“绿洲”，如果成功，后果不堪设想！浩铭发现自己似乎陷入了一个惊天阴谋之中，危急关头他决定跟各方势力玩一场扭转乾坤的解码游戏......', '99分钟', '中国大陆', '李海龙', '韩庚,凤小岳,李媛,山下智久', 'http://mobile.bwstudent.com/images/movie/stills/jmyx/jmyx1_h.jpg', 'http://mobile.bwstudent.com/images/movie/stills/jmyx/jmyx1.jpg', 9.80, 0.25, '2020-09-03', '2018-08-02 18:16:07');
INSERT INTO `movies` VALUES (13, '一出好戏', '一个普通员工如何通过一次团建，在20个男同事和10个女同事中间突围而出，取代老板，迎娶白富美，走上人生巅峰的故事。', '134分钟', '中国大陆', '黄渤', '黄渤,舒淇,王宝强,张艺兴', 'http://mobile.bwstudent.com/images/movie/stills/ychx/ychx1_h.jpg', 'http://mobile.bwstudent.com/images/movie/stills/ychx/ychx1.jpg', 9.60, 0.15, '2018-09-08', '2018-08-09 18:11:51');
INSERT INTO `movies` VALUES (15, '爱情公寓', '《爱情公寓》电影版归来，原班人马十年催泪重聚。曾小贤、胡一菲、唐悠悠、吕子乔、张伟、陈美嘉悉数回归，还是熟悉的场景和熟悉的人，嘻嘻哈哈、打打闹闹，笑声从没停过。老朋友的故事将继续展开，印证了电视剧的那句主题语——“最好的朋友在身边，最爱的人就在对面”。不过这一次，他们打算搞个大事情……', '116分钟', '中国大陆', '韦正', '陈赫,娄艺潇,邓家佳,孙艺洲', 'http://mobile.bwstudent.com/images/movie/stills/aqgy/aqgy1_h.jpg', 'http://mobile.bwstudent.com/images/movie/stills/aqgy/aqgy1.jpg', 9.20, 0.28, '2020-08-10', '2018-08-09 18:17:43');
INSERT INTO `movies` VALUES (16, '碟中谍6：全面瓦解', '有时好意会造成恶果，人反而被自己所造成的结果所困扰。伊桑·亨特（汤姆·克鲁斯 饰）和他的IMF团队（亚历克·鲍德温、西蒙·佩吉、文·瑞姆斯）将在最新的电影《碟中谍6：全面瓦解》中再度回归，他们会与观众们熟悉的盟友（丽贝卡·弗格森、米歇尔·莫娜汉）一起与时间赛跑，应对一次任务中出现的意外。亨利·卡维尔、安吉拉·贝塞特和凡妮莎·柯比也将加入本片的演员阵容，电影制片人克里斯托夫·迈考利将会再度担任导演。', '148分钟', '美国', '克里斯托弗·麦奎里', '汤姆·克鲁斯,亨利·卡维尔,丽贝卡·弗格森,西蒙·佩吉', 'http://mobile.bwstudent.com/images/movie/stills/dzd6qmwj/dzd6qmwj1_h.jpg', 'http://mobile.bwstudent.com/images/movie/stills/dzd6qmwj/dzd6qmwj1.jpg', 8.90, 0.20, '2020-09-22', '2018-09-21 09:18:04');
INSERT INTO `movies` VALUES (17, '反贪风暴3', 'ICAC (廉政公署) 陆志廉（古天乐 饰），JFIU (联合财富情报组) 刘保强（张智霖 饰）分别侦查贪污及洗黑钱案，但苦无线索，这时廉政公署L组 (内部纪律调查组) 程德明（郑嘉颖 饰）收到举报，指陆志廉收贿1200万，陆无法辩解实时停职。刘发现陆被诬陷，并跟一直调查的洗黑钱案有着千丝万缕关系，同时怀疑银行主任游子新（栢天男 饰）协助罪恶集团洗黑钱；陆冒险搜集罪证却遭禁锢，命悬一线.......', '100分钟', '中国大陆,中国香港', '林德禄', '古天乐,张智霖,郑嘉颖,邓丽欣,谢天华', 'http://mobile.bwstudent.com/images/movie/stills/ftfb3/ftfb(3)1_h.jpg', 'http://mobile.bwstudent.com/images/movie/stills/ftfb3/ftfb(3)1.jpg', 9.10, 0.25, '2018-09-22', '2018-09-21 09:18:04');
INSERT INTO `movies` VALUES (18, '黄金兄弟', '狮王（郑伊健 饰）、火山（陈小春 饰）、Bill（谢天华 饰）、淡定（钱嘉乐 饰）、老鼠（林晓峰 饰）五个出生入死的兄弟，在恩师曹sir（曾志伟 饰）的带领下，为了救济儿童而偷取特效药，却惨遭设局，陷入枪林弹雨的险境之中。兄弟们抱着视死如归的豪情，展开一连串的追查与激战。他们明白，即使无法活着回来，也比一人活着痛快！', '100分钟', '中国大陆', '钱嘉乐', '郑伊健,陈小春,谢天华,林晓峰', 'http://mobile.bwstudent.com/images/movie/stills/hjxd/hjxd1_h.jpg', 'http://mobile.bwstudent.com/images/movie/stills/hjxd/hjxd1.jpg', 9.30, 0.22, '2018-09-22', '2018-09-21 09:23:26');
INSERT INTO `movies` VALUES (19, '江湖儿女', '故事起始于2001年的山西大同，模特巧巧（赵涛 饰）与出租车公司老板斌哥（廖凡 饰）是一对恋人，斌哥每天在外面呼朋唤友，巧巧却希望两人能够尽快步入婚姻的殿堂。然而一次斌哥在街头遭到竞争对手的袭击，巧巧为了保护斌哥在街头开枪，被判刑五年。巧巧出狱以后，开始寻找斌哥以便重新开始，然而事情却发生了意想不到的变化。', '136分钟', '中国大陆', '贾樟柯', '赵涛,廖凡,徐峥,梁嘉艳', 'http://mobile.bwstudent.com/images/movie/stills/jhen/jhen1_h.jpg', 'http://mobile.bwstudent.com/images/movie/stills/jhen/jhen1.jpg', 9.70, 0.28, '2018-09-22', '2018-09-21 09:26:18');
INSERT INTO `movies` VALUES (20, '无双', '以代号“画家”（周润发 饰）为首的犯罪团伙，掌握了制造伪钞技术，难辨真伪，并在全球进行交易获取利益，引起警方高度重视。然而“画家”和其他成员的身份一直成谜，警方的破案进度遭受到了前所未有的挑战。在关键时刻，擅长绘画的李问（郭富城 饰）打开了破案的突破口，而“画家”的真实身份却让众人意想不到……', '130分钟', '中国大陆,中国香港', '庄文强', '周润发,郭富城,张静初,冯文娟,廖启智', 'http://mobile.bwstudent.com/images/movie/stills/ws/ws1_h.jpg', 'http://mobile.bwstudent.com/images/movie/stills/ws/ws1.jpg', 8.60, 0.15, '2018-09-22', '2018-09-21 09:31:14');
INSERT INTO `movies` VALUES (21, '找到你', '律师李捷（姚晨 饰）正在离婚进行时，与前夫争夺女儿抚养权，拼命工作为给孩子最好的生活，幸有保姆孙芳（马伊琍 饰）帮忙照顾孩子视如己出。一日下班，李捷发现保姆孙芳和女儿毫无预兆地消失了，她内心最大的恐惧变成了现实。在追寻孙芳和女儿的下落时，她收到来自家人的谴责声讨，甚至遭到警方的怀疑。几乎崩溃的李捷，靠着惊人的勇气，踏上独自寻访的旅程。在追踪过程中，李捷逐渐接近了另一个女人——保姆孙芳的人生故事，她的身份原先都是谎言，而真相也将浮出水面……', '102分钟', '中国大陆', '吕乐', '姚晨,马伊琍,袁文康,吴昊宸', 'http://mobile.bwstudent.com/images/movie/stills/zdn/zdn1_h.jpg', 'http://mobile.bwstudent.com/images/movie/stills/zdn/zdn1.jpg', 8.50, 0.01, '2018-09-22', '2018-09-21 09:33:55');
